import React from 'react';

export default function SingleSong(props) {
  return (
    <tr className="singleSong">
      <th>Title</th>
      <th>Artist</th>
      <th>Album</th>
      <th>Run Time</th>
      <th>Votes</th>
      Title: {props.title}, Artist: {props.artist}, Album: {props.album},
      Length: {props.length}
    </tr>
  );
}
